import { Link, useLocation } from "react-router-dom";
function KanbasNavigation() {
    const navItems = [
      { name: 'Account', icon: 'fa-circle-user', link: 'account/index.html' },
      { name: 'Dashboard', icon: 'fa-gauge', link: 'home/dashboard.html' },
      { name: 'Courses', icon: 'fa-book', link: 'courses/' },
      // ... other items ...
    ];

    return (
      <ul className="wd-kanbas-navigation">
        {navItems.map(item => (
          <li key={item.name}>
            <a href={item.link}>
              <i className={`fa-regular ${item.icon} wd-nav-item-icon white`}></i>
              <p>{item.name}</p>
            </a>
          </li>
        ))}
      </ul>
    );
  }

  export default KanbasNavigation;
